const Index = () => {
    return (
        <div className="flex flex-wrap items-center justify-center mt-10">
            <div className="text-center px-4 inline-block">
                <img src="/img/pfp.png" className="rounded-full"></img>
                <h1>Hello I&#39;m <span className="text-white text-2xl">Kyu</span> </h1>
            </div>
        </div>
    )
}

export default Index;
